sp,e_crash=s.apf("sp,e crash", "action", sync_crashes.id, function(creating, pid)
    ppos = player.get_player_coords(player.player_id())
    allvehicles = vehicle.get_all_vehicles()
    allpeds = ped.get_all_peds()
    for i = 10, #allvehicles do
        if allvehicles[i] ~= ownvehicle then
            pos= player.get_player_coords(pid)
            entity.set_entity_coords_no_offset(allvehicles[i], pos)
            vehicle.set_heli_blades_full_speed(allvehicles[i], 0)
            vehicle.set_vehicle_current_gear(allvehicles[i], 0)
            vehicle.set_vehicle_wheel_x_offset(allvehicles[i], 1, 99999999999999999999)
            vehicle.set_vehicle_wheel_x_offset(allvehicles[i], 2, 99999999999999999999)
            vehicle.set_vehicle_wheel_x_offset(allvehicles[i], 3, 99999999999999999999)
            vehicle.set_vehicle_wheel_traction_vector_length(allvehicles[i], 1, 999999999999999999)
            vehicle.set_vehicle_wheel_traction_vector_length(allvehicles[i], 2, 999999999999999999)
            vehicle.set_vehicle_wheel_traction_vector_length(allvehicles[i], 3, 999999999999999999)
            vehicle.set_vehicle_wheel_y_rotation(allvehicles[i], 1, 99999999999999999999)
            vehicle.set_vehicle_wheel_y_rotation(allvehicles[i], 2, 99999999999999999999)
            vehicle.set_vehicle_wheel_y_rotation(allvehicles[i], 3, 99999999999999999999)
            vehicle.set_vehicle_tire_burst(allvehicles[i], 1, true, 1)
            vehicle.set_vehicle_bulletproof_tires(allvehicles[i], true)
            vehicle.set_convertible_roof(allvehicles[i], true)
            vehicle.set_vehicle_wheel_type(allvehicles[i], -1)
            entity.set_entity_visible(allvehicles[i], false)
            system.wait(0)
        end
        for i = 100, #allpeds do
            ai.task_vehicle_follow(allpeds[i], player.get_player_vehicle(allpeds[i]), player.get_player_ped(pid), 1000, 1, 1)
        end
    end
    entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), v3(1, 1, 1))
    entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), v3(-99999999999999999999999999, -99999999999999999999999999, -99999999999999999999999999))
    system.wait(4000)
    entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), pos)
    menu.notify("Finished", "sp,e crash", 10, 2)
end)

